import React from 'react';
import './Header.css'; // Import CSS file for styling (if needed)

function Header() {
    return (
        <header className="header">
            <div className="logo">dashboard</div>
            <nav className="nav">
                <ul>

                    <li><a href="/profile">Profile</a></li>

                </ul>
            </nav>
        </header>
    );
}

export default Header;
